const Toolbar = (props) =>
{
    return (
        <div className="toolbar container">
            <i className="fas fa-terminal"></i>
            <i className="">{props.title}</i>
            <i className="fas fa-expand-arrows-alt"></i>
        </div>
    );
}

export default Toolbar;
